#Find the length of longest substring without repeating characters
#very bad run-time, takes forever to run for large strings
class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        maxlength = 0
        if len(s) <2:
            return len(s)
        for i in xrange(len(s)):
            for j in xrange(i,len(s)): #i or i+1?
                sub = s[i:j]
                if len(sub) == len(set(sub)): #that means all chars are distict
                    maxlength = max(maxlength,len(sub))
        return maxlength

